    function convertDate($dateString)
    {
        // Daftar bulan Indonesia ke Inggris
        $months = [
            'Januari' => 'January',
            'Februari' => 'February',
            'Maret' => 'March',
            'April' => 'April',
            'Mei' => 'May',
            'Juni' => 'June',
            'Juli' => 'July',
            'Agustus' => 'August',
            'September' => 'September',
            'Oktober' => 'October',
            'November' => 'November',
            'Desember' => 'December'
        ];

        // Ganti nama bulan Indonesia ke Inggris agar bisa dibaca DateTime
        $dateString = strtr($dateString, $months);

        // Jika ada koma (nama hari), ambil bagian setelah koma
        if (strpos($dateString, ',') !== false) {
            $parts = explode(',', $dateString);
            $dateString = trim(end($parts));
        }

        // Buat objek DateTime
        $date = DateTime::createFromFormat('d F Y', $dateString);

        // Jika gagal parsing, kembalikan null atau string kosong
        if (!$date) {
            return null;
        }

        // Kembalikan format yyyy-mm-dd
        return $date->format('Y-m-d');
    }

