        $map = [
            'Januari' => '01',
            'January' => '01',
            'Februari' => '02',
            'February' => '02',
            'Maret' => '03',
            'March' => '03',
            'April' => '04',
            'Mei' => '05',
            'May' => '05',
            'Juni' => '06',
            'June' => '06',
            'Juli' => '07',
            'July' => '07',
            'Agustus' => '08',
            'August' => '08',
            'September' => '09',
            'Oktober' => '10',
            'October' => '10',
            'November' => '11',
            'Desember' => '12',
            'December' => '12'
        ];

        // Normalisasi kapitalisasi
        $month = ucfirst(strtolower(trim($month)));

        // Kembalikan angka bulan (atau null jika tidak dikenali)
        return $map[$month] ?? null;
    }
}
